Latest addition to my Tudor library!
💜💜💜

@sandravasolibooks is a masterful storyteller with a flair for weaving fact and fiction into a vivid and compelling narrative. In ‘Truth Endures’, the reader is invited to walk alongside a refreshingly rich and nuanced Anne Boleyn, as she navigates the trials, joys and tribulations of her life, all of which emerge from the pages in dazzling and spellbinding detail. This expertly crafted and immersive novel offers readers the unique experience of hearing Anne’s story in her own words. It’s historical fiction at its very best!
